import React, { useState } from 'react';
import directorService from '../../services/directorService';

function CrearProfesorForm() {
  const [rut, setRut] = useState('');
  const [nombre, setNombre] = useState('');
  const [apellido, setApellido] = useState('');
  const [direccion, setDireccion] = useState('');
  const [telefono, setTelefono] = useState('');
  const [correo, setCorreo] = useState('');
  const [fechaNacimiento, setFechaNacimiento] = useState('');
  const [password, setPassword] = useState('');
  const [asignaturas, setAsignaturas] = useState([]); // Para las asignaturas
  const [asignaturaSeleccionada, setAsignaturaSeleccionada] = useState(''); // Asignatura seleccionada

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      await directorService.crearProfesor({
        rut,
        nombre,
        apellido,
        direccion,
        telefono,
        correo,
        fecha_nacimiento: fechaNacimiento,
        password,
        rol: 'PROFESOR', // Aseguramos que el rol sea PROFESOR
        asignaturas, // Enviamos las asignaturas seleccionadas
      });
      // Limpiar el formulario y mostrar un mensaje de éxito
    } catch (error) {
      console.error("Error al crear el profesor:", error);
      // Mostrar un mensaje de error al usuario
    }
  };

  const handleAsignaturaChange = (e) => {
    const value = e.target.value;
    setAsignaturaSeleccionada(value);
    // Agregar la asignatura seleccionada al array de asignaturas
    if (value && !asignaturas.includes(value)) {
      setAsignaturas([...asignaturas, value]);
    }
  };

  const handleRemoveAsignatura = (asignatura) => {
    setAsignaturas(asignaturas.filter(item => item !== asignatura));
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="rut">Rut:</label>
        <input
          type="text"
          id="rut"
          value={rut}
          onChange={(e) => setRut(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="nombre">Nombre:</label>
        <input
          type="text"
          id="nombre"
          value={nombre}
          onChange={(e) => setNombre(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="apellido">Apellido:</label>
        <input
          type="text"
          id="apellido"
          value={apellido}
          onChange={(e) => setApellido(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="direccion">Dirección:</label>
        <input
          type="text"
          id="direccion"
          value={direccion}
          onChange={(e) => setDireccion(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="telefono">Teléfono:</label>
        <input
          type="text"
          id="telefono"
          value={telefono}
          onChange={(e) => setTelefono(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="correo">Correo:</label>
        <input
          type="email"
          id="correo"
          value={correo}
          onChange={(e) => setCorreo(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="fechaNacimiento">Fecha de Nacimiento:</label>
        <input
          type="date"
          id="fechaNacimiento"
          value={fechaNacimiento}
          onChange={(e) => setFechaNacimiento(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="password">Contraseña:</label>
        <input
          type="password"
          id="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
      </div>

      {/* Campo para seleccionar asignaturas */}
      <div>
        <label htmlFor="asignatura">Asignaturas:</label>
        <select
          id="asignatura"
          value={asignaturaSeleccionada}
          onChange={handleAsignaturaChange}
        >
          <option value="">Seleccionar Asignatura</option>
          {/* Aquí deberías mostrar las asignaturas disponibles */}
          <option value="Matematica">Matematica</option>
          <option value="Lenguaje">Lenguaje</option>
          <option value="Ciencias">Ciencias</option>
        </select>
      </div>
      {/* Muestra las asignaturas seleccionadas */}
      <div>
        {asignaturas.length > 0 && (
          <ul>
            {asignaturas.map((asignatura, index) => (
              <li key={index}>
                {asignatura}
                <button type="button" onClick={() => handleRemoveAsignatura(asignatura)}>
                  Eliminar
                </button>
              </li>
            ))}
          </ul>
        )}
      </div>

      <button type="submit">Crear Profesor</button>
    </form>
  );
}

export default CrearProfesorForm;
